import React from "react";
import {BrowserRouter as Router, Routes, Route} from "react-router-dom";
import "./App.css";
import Home from "./pages/Home";

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path ="/" component = {Home} exact/>
      </Routes>
    </Router>
  )
}

export default App;
